// --- MOBILE ---
ul {
  list-style-type: none;
}
.container__header {
  padding-top: 6px;
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.header-wrapper {
  position: relative;
  width: 100%;
  margin: 0 auto;
  background-color: $primaryPink;
  padding-bottom: 36px;
  z-index: 1;
}

.relative {
  position: relative;
  padding-bottom: 250px;
  overflow: hidden;
  z-index: 1;
}

.header {
  &__btn {
    display: none;
  }

  &__logo {
    font-size: 0;
  }
}

.mobile-menu {
  margin-bottom: 36px;

  &__link {
    display: block;
    font-weight: 700;
    font-size: 14px;
    line-height: 1.285;
    color: $white;
    padding-right: 35px;
    text-decoration: none;
    border-bottom: 1px solid $borderPink;
    margin-bottom: 10px;
    padding-bottom: 13px;

    &--last {
      padding-right: 0;
    }

    &:hover,
    &:focus {
      color: $red;
    }
  }
}

.header {
  &__tablet-menu {
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  &__btn {
    display: none;
  }

  &__logo {
    font-size: 0;
  }
}

.mobile__open-btn {
  height: 14px;
  width: 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0;
  padding: 0;
  background-color: transparent;
  cursor: pointer;
  border: none;
  border-radius: 50%;
  outline: none;
}

.main-navigation {
  text-decoration: none;
  display: none;
}

.mobile-menu {
  position: fixed;
  top: 0;
  right: 0;
  width: 100%;
  visibility: hidden;
  height: 100%;
  padding: 60px 34px;
  background-color: $darkPink;
  box-shadow: 0px 4px 8px rgba(0, 0, 0, 0.04), 0px 2px 4px rgba(0, 0, 0, 0.08),
    0px 1px 3px rgba(0, 0, 0, 0.16);
  z-index: 100;
  transform: translateX(100%);
  transition: visibility 250ms, transform 250ms cubic-bezier(0.4, 0, 0.2, 1);

  &__close-btn {
    position: absolute;
    top: 21px;
    right: 25px;
    fill: $white;
    background-color: transparent;
    border: none;
  }

  &__link {
    display: block;
    font-weight: 700;
    font-size: 14px;
