sources.sass\\components\\_customer.scss:
.customer-reviews {
  justify-content: center;
  align-items: center;
  display: flex;
  flex-direction: column;
  padding: 80px 0 86px;
  @media screen and (min-width: 768px) {
    padding: 123px 0 132px;
  }

  &__image {
    background-color: $white;
    display: flex;

    &-input {
      margin: 0 auto;
    }
  }

  &__two {
    background-color: $bgGray;
    max-width: 100%;
    height: 308px;
    margin: 30px 0;
    align-items: center;
    display: flex;
    justify-content: center;
    z-index: 1;

    @media screen and (min-width: 768px) {
      height: 164px;
    }
    @media screen and (min-width: 1280px) {
      height: 138px;
      margin: 15px 0;
    }

    &-text {
      font-weight: 500;
      font-size: 12px;
      line-height: 255%;
      text-align: center;
      display: flex;
      flex-direction: column;
      justify-content: center;
      max-width: 157px;
      background: repeating-linear-gradient(#fafafa, #fafafa 28px, #e1e1e1 28px, #e1e1e1 30px);
      z-index: 0;
      position: relative;

      @media screen and (min-width: 768px) {
        font-weight: 500;
        font-size: 14px;
        line-height: 216%;
        text-align: center;
        letter-spacing: 0.04em;
        color: $black;
        max-width: 460px;
        max-height: 83px;
        background: repeating-linear-gradient(#fafafa, #fafafa 26px, #e1e1e1 26px, #e1e1e1 28px);
      }

      @media screen and (min-width: 1280px) {
        font-size: 16px;
        line-height: 1.86;
        max-width: 750px;
        max-height: 52px;
        background: repeating-linear-gradient(#fafafa, #fafafa 24px, #e1e1e1 24px, #e1e1e1 26px);
      }
    }

    &-text::before {
      z-index: -1;
      color: #e1e1e1;
      width: 54px;
      height: 40px;
      content: url('../images/cudzyslow.png');
      position: absolute;
      top: -17px;
      left: 9px;

      @media screen and (min-width: 768px) {
        top: -23px;
        left: -40px;
      }
      @media screen and (min-width: 1280px) {
        top: -20px;
        left: -38px;
      }
    }
  }

  &__interactive {
    background-color: $white;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    &-elipse {
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: row;
      gap: 10px;
      color: $elipseRed;

      &-items {
        padding-left: 0px;
        color: $elipseRed;
        list-style: none;
        text-decoration: none;
      }

      &-tytul {
        margin-top: 18px;
        align-items: center;
        font-weight: 500;
        font-size: 14px;
        line-height: 1.86;
        text-align: center;
        letter-spacing: 0.02em;
        color: $black;

        @media screen and (min-width: 768px) {
          margin-top: 15px;
          font-size: 16px;
        }

        @media screen and (min-width: 1280px) {
          margin-top: 13px;
          align-items: center;
          font-weight: 500;
          font-size: 20px;
          line-height: 1.86;
          text-align: center;
          letter-spacing: 0.02em;
          color: $black;
        }
      }
    }

    &-elipse2 {
      display: flex;
      justify-content: center;
      align-items: center;
      flex-direction: row;
      gap: 10px;
      color: $elipseRed;
      list-style: none;

      &-items2 {
        display: flex;
        padding-left: 0px;
        text-decoration: none;
        list-style: none;
      }
    }
  }
}

sources.sass\\components\\_contacts.scss:
/*--- global ---*/
.contacts {
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  ul {
    list-style: none;
  }

  &__container {
    z-index: 3;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
  }
}
// link-global
.contacts {
  &__email-tel {
    a {
      font-family: 'DM Sans', sans-serif;
      font-weight: 500;
      color: $textGrey;
      text-decoration: none;
    }
  }
}
// lists-global
.contacts {
  &__list {
    z-index: 3;
    padding-left: 0px;
    margin: 0;
  }
  &__list-days {
    padding-left: 0%;
    display: flex;
    flex-direction: column;
  }
  &__list-item {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    background-color: $white;
    box-shadow: 0px 0px 35px -12px rgb(255, 184, 202);
    border-radius: 24px;
  }
  &__item {
    padding: 0px;
    display: grid;
    &:nth-child(1) {
      grid-column: 1;
      grid-row: 1;
    }
    &:nth-child(2) {
      grid-column: 1;
      grid-row: 2;
    }
    &:nth-child(3) {
      grid-column: 1;
      grid-row: 3;
    }
  }
  &__email-tel {
    display: flex;
    flex-direction: column;
  }
}
// header-global
.contacts {
  h3 {
    font-weight: 500;
    font-family: 'DM Sans', sans-serif;
  }
  h4 {
    font-weight: 500;
    font-family: 'DM Sans', sans-serif;
  }
  &__none-header {
    display: none;
  }
}
.contacts {
  &__header-caffe {
    align-self: flex-start;
    color: $white;
    width: 80px;
    height: 16px;
    background-color: $coffe;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 4px;
  }
  &__header-truck {
    align-self: flex-start;
    color: $white;
    width: 130px;
    height: 16px;
    background-color: $green;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: 4px;
  }
  &__header-description {
    color: $black;
  }
  &__header-days {
    color: $black;
  }
}
// text-global
div {
  p {
    font-weight: 500;
    color: $textGrey;
    font-family: 'DM Sans', sans-serif;
  }
}
.contacts {
  &__p-days {
    font-family: 'DM Sans', sans-serif;
    color: $textPink;
  }
}
// buttons-global
button {
  cursor: pointer;
}
.contacts {
  &__button-franchise:focus {
    outline: none;
    background-color: $red;
    .button-text {
      color: $white;
    }
    .button-icon {
      fill: $white;
    }
  }
  &__franchise {
    text-decoration: none;
    outline: none;
  }

  &__buttons {
    z-index: 3;
    display: flex;
  }
  &__button-location {
    border: none;
    background-color: $red;
    border-radius: 25px;
    width: 161px;
    height: 44px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    .button-text {
      font-family: 'DM Sans', sans-serif;
      font-weight: 700;
      font-size: 16px;
      line-height: 21px;
      color: $white;
      transition: color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-franchise {
    border: none;
    background-color: $white;
    width: 161px;
    height: 44px;
    border-radius: 25px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    .button-text {
      font-family: 'DM Sans', sans-serif;
      font-weight: 700;
      font-size: 16px;
      line-height: 21px;
      color: $red;
      transition: color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-location {
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 13.17px;
    margin-bottom: 10px;
    .button-icon {
      width: 10px;
      height: 10px;
      fill: $white;
      transition: fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-franchise {
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 13.17px;
    .button-icon {
      width: 10px;
      height: 10px;
      fill: $red;
      transition: fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }
  &__button-franchise:hover {
    background-color: $red;
    .button-text {
      color: $white;
    }
    .button-icon {
      fill: $white;
    }
  }

  &__button-location:hover {
    background-color: $white;
    .button-text {
      color: $red;
    }
    .button-icon {
      fill: $red;
    }
  }
  &__button-location:focus {
    outline: none;
    background-color: $white;
    .button-text {
      color: $red;
    }
    .button-icon {
      fill: $red;
    }
  }
}
/*------*/

/*--- mobile-set ---*/
/*... grid-set ...*/
@media screen and (min-width: 320px) and (max-width: 767px) {
  .contacts {
    &__list {
      align-items: center;
      justify-content: center;
      display: grid;
      gap: 20px;
      & > :nth-child(1) {
        grid-column: 1;
        grid-row: 1;
      }
      & > :nth-child(2) {
        grid-column: 1;
        grid-row: 2;
      }
      & > :nth-child(3) {
        grid-column: 1;
        grid-row: 3;
      }
    }
  }
}
// list-mobile
@media screen and (min-width: 320px) and (max-width: 767px) {
